const Dog = (props) => {

    return(
        <div classname="singleDog" style={{outline:"solid black 2px", margin:"auto", width:"30%"}}>
            <p classname="name">{props.name}</p>
            <p classname="age">{props.age}</p>
            <img src={props.img} alt="Dog picture" style={{width:"20%"}}/>
        </div>
    )
}
export default Dog
